import React from 'react';

const About = () => {
    return (
        <section id="about">
            <h2>Sobre mí</h2>
            <p>Hola, soy [Tu Nombre], un desarrollador web apasionado por crear experiencias digitales únicas.</p>
            <p>Me especializo en el desarrollo de aplicaciones utilizando tecnologías modernas como React, JavaScript y CSS.</p>
            <p>En mi tiempo libre, disfruto aprender nuevas tecnologías y trabajar en proyectos personales.</p>
        </section>
    );
};

export default About;
